description:
Category	Feature, Plot Based

Starring	Casey Calvert, Anthony Rosano, Steven St Croix, Alec Knight, Adriana Chechik, Logan Pierce, Nikki Daniels, Dahlia Sky

Hoping that he can teach her how to be a perfect lover before she walks down the aisle, Tracy pleads with her future father-in-law to take her virginity. The morning of his wedding day, Kyle finds himself pulled back into a forbidden affair with his stepsister, Allison. After Randy lectures his promiscuous niece about the importance of celibacy, he begins to rethink his values when he finds himself falling for her seduction. Best Man, Mike couldn't be less enthused about his brother's wedding until his stepmother steals him away for an illicit pre-ceremony tryst.

